(26, 1, '2020-04-13 12:11:25', '2020-04-13 12:11:25', '<div class=\"row\">\r\n<div class=\"col-md-12\">\r\nThe Total Cost for the total number of sessions is <strong>Rs.3000</strong>. The maximum number per group to be <strong>7 kids</strong>. For more information, contact\r\n</div>\r\n<br/>\r\n<br/>\r\n<div class=\"col-md-5\">\r\n<h1>About Myself</h1>\r\n<img src=\"https://impactatkay.com/register/wp-content/uploads/2020/04/impactatkay-283x300.jpg\" alt=\"\" width=\"283\" height=\"300\" class=\"alignnone size-medium wp-image-19\" />\r\n<h3>Hello I\'m Kamini</h3>\r\n<p style=\"text-align: justify;\">I am an experienced Transformative Life Coach with a demonstrated history of working with people across all ages and finding definitive solutions through Coaching. Mentored and Coached by World Renowned Coaches and Trainers, I will work with you to empower you with the understanding and skills to maneuver through situations. I’ve lived and worked in India and the Nigeria, and have accumulated over 10 years as a Coach, Mentor, Trainer… My diverse portfolio includes working with Business Leaders, Teams, Entrepreneurs, Professionals, Home makers turning Entrepreneurs. My experiences in two of India’s largest Textile organizations – The Raymond Woolen Mills Ltd., and Mafatlal Industries Ltd., gave me an early solid grasp of what it takes to lead in a fast-paced, demanding culture. Responsible for Product management, Client Development, Change Management and Employee Engagement, I understand the nature of corporate organizations and the challenges faced by their leaders. I work with my insights, am direct, honest, caring… and even funny. I’ve had the pleasure of working for many years with great clients and helped them in both professional and personal realms as a leader</p>\r\n</div>\r\n<div class=\"col-md-7\">\r\n[wpforms id=\"6\" title=\"false\" description=\"false\"]\r\n</div>\r\n</div>', 'Registration', '', 'inherit', 'closed', 'closed', '', '7-revision-v1', '', '', '202