(67, 1, '2020-04-28 10:11:30', '2020-04-28 10:11:30', '<img src=\"https://impactatkay.com/register/wp-content/uploads/2020/04/kay.jpg\" alt=\"\" width=\"1920\" height=\"450\" class=\"alignnone size-full wp-image-52\" />\r\n<div class=\"row\" style=\"background:#FFF; padding: 20px;\r\n    border: 2px solid #008080;\r\n    border-radius: 12px;\">\r\n<div class=\"col-md-12\">\r\n<p><strong>Who Can Join KAYtalyst?</strong></p>\r\n<p>Kids and Teenagers who wish to improve their personal & interpersonal skills through exciting and innovative learning methods.</p>\r\n\r\n<p><strong>Why Should You Join KAYtalyst?</strong></p>\r\n<p>Our lively Summer Crash Course turns your kid\'s regular holidays into a productive one by expanding their skill set and allows them to emerge out as great leaders of tomorrow.</p>\r\n</div>\r\n<br/>\r\n<br/>\r\n<div class=\"col-md-5\">\r\n<h1>About Myself</h1>\r\n<img src=\"https://impactatkay.com/register/wp-content/uploads/2020/04/impactatkay-283x300.jpg\" alt=\"\" width=\"283\" height=\"300\" class=\"alignnone size-medium wp-image-19\" />\r\n<h3>Hello I\'m Kamini</h3>\r\n<p style=\"text-align: justify;\">For everyone who needs this today?\r\nWhat if???\r\nIf they cancel the rest of the school year, students would miss 3 months of education. Many people are concerned about <strong>students </strong>FALLING BEHIND because of this. Yes, they may fall behind when it comes to classroom education.\r\n\r\n<strong>BUT WHAT IF...</strong>\r\nWhat if instead of falling <strong>“behind\"</strong>, this group of kids is <strong>ADVANCED </strong>because of this? \r\n\r\nWhat if they have more <strong>empathy</strong>, they enjoy family connection, they can be more <strong>creative </strong>and entertain themselves, they love to <strong>read</strong>, they love to <strong>express </strong>themselves in <strong>writing</strong>. \r\n\r\nWhat if they <strong>enjoy </strong>the simple things, like their own garden and sitting near a window in the quiet.\r\n\