(90, 1, '2020-05-04 10:25:21', '2020-05-04 10:25:21', '<img src=\"https://impactatkay.com/register/wp-content/uploads/2020/04/kay.jpg\" alt=\"\" width=\"1920\" height=\"450\" class=\"alignnone size-full wp-image-52\" />\r\n<div class=\"row\" style=\"background:#FFF; padding: 20px;\r\n    border: 2px solid #008080;\r\n    border-radius: 12px;\">\r\n<div class=\"col-md-12\">\r\n<p><strong>Who Can Join KAYtalyst?</strong></p>\r\n<p>Kids and Teenagers who wish to improve their personal & interpersonal skills through exciting and innovative learning methods.</p>\r\n\r\n<p><strong>Why Should You Join KAYtalyst?</strong></p>\r\n<p>Our lively Course turns your kid\'s regular holidays into a productive one by expanding their skill set and allows them to emerge out as great leaders of tomorrow.</p>\r\n</div>\r\n<br/>\r\n<br/>\r\n<div class=\"col-md-5\">\r\n<h1>About Myself</h1>\r\n<img src=\"https://impactatkay.com/register/wp-content/uploads/2020/04/impactatkay-283x300.jpg\" alt=\"\" width=\"283\" height=\"300\" class=\"alignnone size-medium wp-image-19\" />\r\n<h3>Hello I\'m Kamini</h3>\r\n<p style=\"text-align: justify;\">For everyone who needs this today?\r\nWhat if???\r\nIf they cancel the rest of the school year, students would miss 3 months of education. Many people are concerned about <strong>students </strong>FALLING BEHIND because of this. Yes, they may fall behind when it comes to classroom education.\r\n\r\n<strong>BUT WHAT IF...</strong>\r\nWhat if instead of falling <strong>“behind\"</strong>, this group of kids is <strong>ADVANCED </strong>because of this? \r\n\r\nWhat if they have more <strong>empathy</strong>, they enjoy family connection, they can be more <strong>creative </strong>and entertain themselves, they love to <strong>read</strong>, they love to <strong>express </strong>themselves in <strong>writing</strong>. \r\n\r\nWhat if they <strong>enjoy </strong>the simple things, like their own garden and sitting near a window in the quiet.\r\n\r\nWhat if they <strong>notice </strong>the birds and the dates the different flowers emerge, and the calming renewal of a gentle rain shower?\r\n\r\nWhat if this <strong>generation </strong>is the ones to learn to cook, organize their space, do their laundry, and keep a well-run home?\r\n\r\nWhat if they learn to <strong>stretch </strong>a ₹100 and to live with less? \r\n\r\nWhat if they learn to <strong>plan </strong>shopping, trips, and meals at home. \r\n\r\nWhat if they learn the <strong>value </strong>of eating together as a <strong>family </strong>and finding the good to share in the small delights of the everyday? \r\n\r\nWhat if they are the ones to place <strong>great </strong>value on our NHS, teachers and educational professionals, librarians, public servants and the previously invisible essential support workers like truck drivers, grocers, cashiers, custodians, logistics, and health care workers and their supporting staff, just to name a few of the millions taking care of us right now while we are sheltered in place?\r\n\r\nWhat if among these children, a <strong>great leader</strong> emerges who had the benefit of a slower pace and a simpler life to truly learn what really matters in this life?\r\n\r\nWhat if they are actually <strong>AHEAD?</strong> ❤️\r\n</p>\r\n</div>\r\n<div class=\"col-md-7\">\r\n <nav>\r\n   <div class=\"nav nav-tabs nav-fill\" id=\"nav-tab\" role=\"tablist\">\r\n          <a class=\"nav-item nav-link active\" id=\"nav-home-tab\" data-toggle=\"tab\" href=\"#nav-home\" role=\"tab\" aria-controls=\"nav-home\" aria-selected=\"true\">Quick Pay</a>\r\n           <a class=\"nav-item nav-link\" id=\"nav-profile-tab\" data-toggle=\"tab\" href=\"#nav-profile\" role=\"tab\" aria-controls=\"nav-profile\" aria-selected=\"false\">Enquire Now</a>\r\n    </div>\r\n  </nav>\r\n <div class=\"tab-content\" id=\"nav-tabContent\">\r\n    <div class=\"tab-pane fade show active\" id=\"nav-home\" role=\"tabpanel\" aria-labelledby=\"nav-home-tab\">\r\n        [gravityform id=\"3\" title=\"false\" description=\"false\" ajax=\"true\" tabindex=\"49\" field_values=\"check=First Choice,Second Choice\"]            \r\n    </div>\r\n    <div class=\"tab-pane fade\" id=\"nav-profile\" role=\"tabpanel\" aria-labelledby=\"nav-profile-tab\">\r\n           [gravityform id=\"2\" title=\"false\" description=\"false\" ajax=\"true\" tabindex=\"49\" field_values=\"check=First Choice,Second Choice\"]              \r\n     </div>\r\n</div>\r\n</div>\r\n</div>', 'Registration', '', 'inherit', 'closed', 'closed', '', '7-revision-v1', '', '', '2020-05-04 10:25:21', '2020-05-04 10:25:21', '', 7, 'https://impactatkay.com/register/2020/05/04/7-revision-v1/', 0, 'revision', '', 0),
